import React, { useEffect, useState } from 'react'
import DarkMode from './customeHooks/DarkMode.jsx';
//Componunt
import NavBar from './componunts/NavBar.jsx'
//Pages
import Home from './pages/Home.jsx'


function App() {
  const { darkMode, toggleDarkMode } = DarkMode();
  if(darkMode){

    document.body.classList.toggle("dark-theme");
  }


  return (
    <>
      <header className='w-100 bg-white'> 
        <NavBar />
      </header>
      <main className={`container`}>
        <Home />
      </main>

    </>
  );
}

export default App;
